import React, {useState} from 'react';
import { useForm, SubmitHandler } from "react-hook-form"
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import styled from "styled-components";
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import 'dayjs/locale/ko';
import dayjs, {Dayjs} from "dayjs";
import InputDatePicker from "./inputDatePicker";
import InputTimePicker from "./inputTimePicker";
import SelectGender from "./selectGender";

type Inputs = {
    birth: string,
    gender : string,
    goal : string,
    strDate : string,
    endDate : string,
    strTime : string
}

const CustomRadio  = styled(FormControlLabel)`
  & .css-ahj2mt-MuiTypography-root {
    font-size: 14px;
    font-weight: 550;
  }
`
const CustomDate = styled(DatePicker)`
    & .MuiOutlinedInput-root {
      width: 160px;
      height: 45px;
    }
  
    & .css-1d3z3hw-MuiOutlinedInput-notchedOutline {
      top : 0;
    }
`
const Step1: React.FC = () => {
    const {
        register,
        handleSubmit,
        watch,
        control,
        formState: { errors },
    } = useForm<Inputs>()
    const onSubmit: SubmitHandler<Inputs> = (data) => console.log(data)
    return (
        <div className='center-flex flex-col mx-4 mt-2'>
            <div className='border-b-4 font-bold text-[16px] w-full pb-1'>
                가입 정보 입력
            </div>
                <form onSubmit={handleSubmit(onSubmit)} className='h-full w-full flex flex-col mt-4'>
                    {/*여행 목적 선택*/}
                    <div>
                        <div className='font-bold'>여행 목적</div>
                        <RadioGroup
                            row
                            aria-labelledby="demo-row-radio-buttons-group-label"
                            name="row-radio-buttons-group"
                        >
                            <CustomRadio value="여행/관광" control={<Radio size="small" {...register("goal")}/>} label="여행/관광" />
                            <CustomRadio value="출장/업무" control={<Radio size="small" {...register("goal")}/>} label="출장/업무" />
                            <CustomRadio value="유학/연수/캠프" control={<Radio size="small" {...register("goal")} />} label="유학/연수/캠프" />
                        </RadioGroup>
                        <h2 className='base_text'>* 여행국가에 대한 입국제한 조치 상태를 꼭 <a href={'www.naver.com'} target={'_blank'} rel={'noreferrer'} className='base_color'>확인</a>하시기 바랍니다.</h2>
                    </div>

                    {/*여행 기간 선택*/}
                    <div className='font-bold mt-6'>여행 기간</div>
                    <div className='flex w-full mt-4'>
                        <div className='mr-auto'>
                            <InputDatePicker
                                // control을 자식 컴포넌트에 넘겨주기
                                control={control}
                            />
                            <InputTimePicker
                                control={control}
                            />
                            <span className='base_text'>* 출발전까지 가입가능 합니다.</span>
                        </div>
                    </div>
                    <div className='mt-6 flex'>
                        <div className='flex-col'>
                            <h2 className='font-bold pb-2'>여행자 정보</h2>
                            <div className='flex flex-col'>
                                <span className='text-[12px] pb-2'>생년월일</span>
                                <div className='flex'>
                                    <input {...register("birth", { required: true })} className='input' />
                                    <SelectGender
                                        control={control}
                                    />
                                </div>
                            </div>
                            <span className='base_text'>* 만 79세까지 가입이 가능합니다.</span>
                        </div>
                        {/* errors will return when field validation fails  */}
                    </div>
                    {errors.birth && <span>주민등록번호를 입력해주세요</span>}
                    <div className='fixed bottom-0 h-[60px] base_bg w-full left-0 flex justify-center items-center text-white font-bold'>
                        <input type="submit"/>
                    </div>
                </form>
            </div>
    );
};

export default Step1;
